import "./style.css";


import Signup from './Pages/Signup';

function App() {
  return (
    <>
      <Main />
      <Routes>
        <Route path="/" element={<Navigate replace to="Signup" />} />
        <Route path="/Home" element={< Home />} />
        //<Route path="/About" element={< About />} />
      </Routes>
    </>
  );
}

export default App;
